import React from 'react'

const SingleBookCartComponent = () => {
    return (
        <div className='card z-dept-0 single-book'>
            <div className='card-content grey-text text-darken-3 teal lighten-5'>
                <span className='card-title '>{book.title}</span>
                <p className='price-single-component left'>Price: {book.price}</p>
                <span className='grey-text'>Posted by {book.postedByFirstName + ' ' +  book.postedByLastName}</span>
            </div>
        </div>
    )
}

export default SingleBookCartComponent
